  createBrowserRouter,
  RouterProvider,
} from "react-router-dom";

const router = createBrowserRouter([
  {
    path: "/",
    element: <Home />,
  },
  {
    path: "/login",
    element: <FormAuth />,
  },
]);

function App() {
  return (
    <div style={{background:"#223"}}>
      <NavBar />
      <Home/> 
    </div>
  );
}

export default App;
